-- ----------------------------
-- Table structure for fangan
-- ----------------------------
DROP TABLE IF EXISTS `fangan`;
CREATE TABLE `fangan`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `base_id` int(11) NULL DEFAULT NULL COMMENT '项目基础信息表id',
  `repeat_degree` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '产品/赛道重合度',
  `feasibility` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '产品技术应用可行性',
  `communication` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '见客户交流情况',
  `approval_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '是否通过 0不通过 1通过',
  `approval_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作人',
  `approval_time` datetime NULL DEFAULT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '方案部审批' ROW_FORMAT = Dynamic;

