-- Records of fangan
-- ----------------------------

-- ----------------------------
-- Table structure for jiaofu
-- ----------------------------
DROP TABLE IF EXISTS `jiaofu`;
CREATE TABLE `jiaofu`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `base_id` int(11) NULL DEFAULT NULL COMMENT '项目基础信息表id',
  `scope` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '交付服务范围',
  `type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '交付形式 0轻量化交付 1整体交付',
  `is_explicit` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '付款节点和验收流程是否明确 0不明确 1明确',
  `approval_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '是否通过 0不通过 1通过',
  `approval_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作人',
  `approval_time` datetime NULL DEFAULT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '交付部审批' ROW_FORMAT = Dynamic;

