DROP TABLE IF EXISTS `pingtai`;
CREATE TABLE `pingtai`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `base_id` int(11) NULL DEFAULT NULL COMMENT '项目基础信息表id',
  `is_risk` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '是否有技术风险 0否 1是',
  `version` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '平台产品版本',
  `is_share` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '部分是否可由交付开发 0否1是',
  `month` int(11) NULL DEFAULT NULL COMMENT '预计开发周期  单位为月',
  `approval_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '是否通过 0不通过 1通过',
  `approval_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作人',
  `approval_time` datetime NULL DEFAULT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '平台部审批' ROW_FORMAT = Dynamic;

